def calculate_angle(a, b, c):
    a = np.array(a)  # First
    b = np.array(b)  # Mid
    c = np.array(c)  # End

    radians = np.arctan2(c[1] - b[1], c[0] - b[0]) - np.arctan2(a[1] - b[1], a[0] - b[0])
    angle = np.abs(radians * 180.0 / np.pi)

    if angle > 180.0:
       angle = 360 - angle

    return angle


def dt(s1,s2):
    s1 = np.array(s1)
    s2 = np.array(s2)
    path = dtw.warping_path(s1, s2)
    dtwvis.plot_warping(s1, s2, path)
    dist = dtw.distance(s1,s2)
    dist_n = dtw.distance(s1/np.linalg.norm(s1),s2/np.linalg.norm(s2))
    print(dist,dist_n)
    dist = 100*(1-dist)
    dist_n = 100*(1-dist_n)
    return dist,dist_n

def dt_n(s1,s2):
    s1 = np.array(s1)
    s2 = np.array(s2)
    d = dtw_ndim.distance(s1, s2)
    return 100*(1-d)


